defs.value:
pub enum FunctionCallError {
    CompilationError(CompilationError),
    LinkError {
        msg: String,
    },
    MethodResolveError(MethodResolveError),
    WasmTrap(WasmTrap),
    WasmUnknownError,
    HostError(HostError),
}

pub enum MethodResolveError {
    MethodEmptyName,
    MethodUTF8Error,
    MethodNotFound,
    MethodInvalidSignature,
}

pub enum CompilationError {
    CodeDoesNotExist {
        account_id: String,
    },
    PrepareError(PrepareError),
    WasmerCompileError {
        msg: String,
    },
}

pub enum HostError {
    BadUTF16,
    BadUTF8,
    GasExceeded,
    GasLimitExceeded,
    BalanceExceeded,
    EmptyMethodName,
    GuestPanic {
        panic_msg: String,
    },
    IntegerOverflow,
    InvalidPromiseIndex {
        promise_idx: u64,
    },
    CannotAppendActionToJointPromise,
    CannotReturnJointPromise,
    InvalidPromiseResultIndex {
        result_idx: u64,
    },
    InvalidRegisterId {
        register_id: u64,
    },
    IteratorWasInvalidated {
        iterator_index: u64,
    },
    MemoryAccessViolation,
    InvalidReceiptIndex {
        receipt_index: u64,
    },
    InvalidIteratorIndex {
        iterator_index: u64,
    },
    InvalidAccountId,
    InvalidMethodName,
    InvalidPublicKey,
    ProhibitedInView {
        method_name: String,
    },
    NumberOfLogsExceeded {
        limit: u64,
    },
    KeyLengthExceeded {
        length: u64,
        limit: u64,
    },
    ValueLengthExceeded {
        length: u64,
        limit: u64,
    },
    TotalLogLengthExceeded {
        length: u64,
        limit: u64,
    },
    NumberPromisesExceeded {
        number_of_promises: u64,
        limit: u64,
    },
    NumberInputDataDependenciesExceeded {
        number_of_input_data_dependencies: u64,
        limit: u64,
    },
    ReturnedValueLengthExceeded {
        length: u64,
        limit: u64,
    },
    ContractSizeExceeded {
        size: u64,
        limit: u64,
    },
    Deprecated {
        method_name: String,
    },
}
